        <script>H5PIntegration = {"ajax":{"setFinished":"","contentUserData":""},"ajaxPath":"/h5p/ajax?action=","contents":{"cid-272525444":{"displayOptions":{"copy":false,"copyright":false,"embed":false,"export":false,"frame":false,"icon":false},"fullScreen":"1","jsonContent":"{\"iconType\":\"icon\",\"icon\":\"exclamation\",\"color\":\"#3a2f3a\",\"hotspots\":[{\"position\":{\"x\":71.69638783298348,\"y\":30.60124312106918},\"alwaysFullscreen\":false,\"content\":[{\"library\":\"H5P.Text 1.1\",\"params\":{\"text\":\"<p>Un <strong>virus informático</strong> es un programa malicioso creado para alterar el funcionamiento normal de una computadora sin que el usuario lo note. Los virus pueden:</p><ul><li>Borrar o dañar archivos importantes.</li><li>Cambiar configuraciones del sistema.</li><li>Hacer que el equipo vaya lento.</li><li>Bloquear programas.</li><li>Mostrar mensajes extraños.</li><li>Robar información personal.</li></ul>\"},\"metadata\":{\"contentType\":\"es\",\"license\":\"U\",\"title\":\"Sin título es\",\"authors\":[],\"changes\":[]},\"subContentId\":\"c5f48f02-4825-461b-ba73-3ea0f8d875b5\"}],\"header\":\"¿Qué es un virus informático?\"},{\"position\":{\"x\":81.06995893494965,\"y\":55.98742138364779},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Un virus no funciona por sí mismo; requiere que el usuario abra el archivo infectado. Una vez activado, puede:</p><ol><li><strong>Duplicarse</strong> dentro de la computadora.</li><li><strong>Infectar otros archivos</strong> o programas.</li><li><strong>Afectar el sistema</strong>, borrando o modificando información.</li><li><strong>Tratar de propagarse</strong> a otras computadoras mediante redes o dispositivos USB.</li></ol>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"es\",\"license\":\"U\",\"title\":\"Sin título es\",\"authors\":[],\"changes\":[]},\"subContentId\":\"669ad62f-d37c-44c3-8ec5-597b75ddb317\"}],\"header\":\"¿Cómo ataca un virus?\"},{\"position\":{\"x\":72.15363520381109,\"y\":82.76478970125785},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Los virus pueden llegar a un equipo mediante acciones comunes, como:</p><ul><li>Abrir correos falsos o desconocidos.</li><li>Descargar archivos de páginas no seguras.</li><li>Instalar programas piratas o cracks.</li><li>Hacer clic en anuncios engañosos.</li><li>Conectar una memoria USB infectada.</li><li>Instalar aplicaciones no verificadas en el celular.</li></ul><p>Hoy en día también existen virus que se propagan por redes sociales o por mensajes que parecen ser enviados por un amigo, pero en realidad son falsos.</p>\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"es\",\"license\":\"U\",\"title\":\"Sin título es\",\"authors\":[],\"changes\":[]},\"subContentId\":\"4d6c19a8-9551-42c2-a766-84b27f952ef8\"}],\"header\":\"¿Cómo se propagan los virus?\"}],\"hotspotNumberLabel\":\"Punto clave #num\",\"closeButtonLabel\":\"Cerrar\",\"containsAudioVideoLabel\":\"Contains Audio/Video\",\"image\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAB4AAAAQ4CAIAAABnsVYUAAAACXBIWXMAAA7EAAAOxAGVKw4bAAAE+2lUWHRYTUw6Y29tLmFkb2JlLnhtcAAAAAAAPD94cGFja2V0IGJlZ2luPSfvu78nIGlkPSdXNU0wTXBDZWhpSHpyZVN6TlRjemtjOWQnPz4KPHg6eG1wbWV0YSB4bWxuczp4PSdhZG9iZTpuczptZXRhLyc+CjxyZGY6UkRGIHhtbG5zOnJkZj0naHR0cDovL3d3dy53My5vcmcvMTk5OS8wMi8yMi1yZGYtc3ludGF4LW5zIyc+CgogPHJkZjpEZXNjcmlwdGlvbiByZGY6YWJvdXQ9JycKICB4bWxuczpBdHRyaWI9J2h0dHA6Ly9ucy5hdHRyaWJ1dGlvbi5jb20vYWRzLzEuMC8nPgogIDxBdHRyaWI6QWRzPgogICA8cmRmOlNlcT4KICAgIDxyZGY6bGkgcmRmOnBhcnNlVHlwZT0nUmVzb3VyY2UnPgogICAgIDxBdHRyaWI6Q3JlYXRlZD4yMDI1LTExLTI1PC9BdHRyaWI6Q3JlYXRlZD4KICAgICA8QXR0cmliOkV4dElkPjIwZjZkNWQ0LTUxY2QtNGJlYy05OWY0LWQ5MzEyNzMxN2JlNTwvQXR0cmliOkV4dElkPgogICAgIDxBdHRyaWI6RmJJZD41MjUyNjU5MTQxNzk1ODA8L0F0dHJpYjpGYklkPgogICAgIDxBdHRyaWI6VG91Y2hUeXBlPjI8L0F0dHJpYjpUb3VjaFR5cGU+CiAgICA8L3JkZjpsaT4KICAgPC9yZGY6U2VxPgogIDwvQXR0cmliOkFkcz4KIDwvcmRmOkRlc2NyaXB0aW9uPgoKIDxyZGY6RGVzY3JpcHRpb24gcmRmOmFib3V0PScnCiAgeG1sbnM6ZGM9J2h0
